// Before tu run the next part, please read the following steps
// Instructions:

// 1. Create an unique empty ImageCollection, only to configure 'system' with monthly intervals (1980-2020)
// 2. Import assets and create ImageCollections from each variable ('Temp', 'Prcp', 'Run', 'ETReal', 'ETRef')
// 3. Copy the 'system' data (1980-2020) from empty ImageCollection to each variable  
// 4. Rename all 'bands' from ImageCollections from each variable ('temperature', 'precipitation, 'runoff', 'etreal', 'etref')
// 5. Create annual ImageCollections from each variable ('temperature', 'precipitation, 'runoff', 'etreal', 'etref')

//Set the interval data (start and end)
var startDate = ee.Date('1980-01-01');
var endDate = ee.Date('2020-12-30');

// Create an empty ImageCollection with temporal data 'yyy-mm-dd'
var startYear_empty = 1980;
var endYear_empty = 2020;
var years_empty = ee.List.sequence(startYear_empty, endYear_empty);
var years  = years_empty;

var months_empty = ee.List.sequence(1, 12);

//Create a function to set data
var createMonthlyImage = function(year) {
  year = ee.Number(year);
  return months_empty.map(function(month) {
    month = ee.Number(month);
    var startDate = ee.Date.fromYMD(year, month, 1);
    var endDate = startDate.advance(1, 'month');
    var image = ee.Image.constant(0)
      .set('system:time_start', startDate.millis())
      .set('system:time_end', endDate.millis())
    return image;
  });
};

//Create the empty ImageCollection
var monthlyImages_empty = years_empty.map(createMonthlyImage).flatten();
var emptyMonthlyCollection = ee.ImageCollection.fromImages(monthlyImages_empty);

/////************************************************************************ First Variable ***************************************************************************************//////

//************************************* Import and create ImageCollection from Temperature as 'Temp' *******************************************
var Temperature = ee.Image("projects/ee-sebastianpalominoangel/assets/Assets_BM_Bolivia/Tmedio_M1_M492_multiband")
var bandNames_temp = Temperature.bandNames();

var imageList_Temp = bandNames_temp.map(function(bandName) {
      var image = Temperature.select([bandName])
      return image.set({
        'system:time_start': startDate.millis(),
        'system:time_end': endDate.millis(),
      })
});

var imageCollection_Temp = ee.ImageCollection.fromImages(imageList_Temp);
var sourceCollection_temp = emptyMonthlyCollection
var targetCollection_temp = imageCollection_Temp
var sourceList_temp = sourceCollection_temp.toList(sourceCollection_temp.size());
var targetList_temp = targetCollection_temp.toList(targetCollection_temp.size());

var updatedImages_temp = ee.List.sequence(0, sourceList_temp.size().subtract(1)).map(function(i) 
{
  var sourceImage_temp = ee.Image(sourceList_temp.get(i));
  var targetImage_temp = ee.Image(targetList_temp.get(i));
  var timeStart_temp = sourceImage_temp.get('system:time_start');
  var timeEnd_temp = sourceImage_temp.get('system:time_end');

  return targetImage_temp
    .set('system:time_start', timeStart_temp)
    .set('system:time_end', timeEnd_temp)
});

var updatedCollection_Temp = ee.ImageCollection.fromImages(updatedImages_temp);

//************************************* Rename all bands to 'Temperature' *******************************************

var renameBands = function(image) {
  var originalBandNames = image.bandNames();
  var newBandNames = ee.List.sequence(0, originalBandNames.length().subtract(1))
      .map(function(index) {
        return 'temperature';
      });
  return image.rename(newBandNames);
};
var Temp_Collection_month = updatedCollection_Temp.map(renameBands);
//print('Monthly ImageCollection of Temperature', Temp_Collection_month)


//************************************* Create Annual ImageCollection with 'temperature' as a band *******************************************
var AnnualImage_Temp = function(year) {
  year = ee.Number(year);
  var annualCollection = Temp_Collection_month
      .filter(ee.Filter.calendarRange(year, year, 'year'));
  var annualImage = annualCollection.mean();
  return annualImage
      .set('year', year)
      .set('system:time_start', ee.Date.fromYMD(year, 1, 1).millis());
};

var AnnualCollection_Temp = ee.ImageCollection.fromImages(
    years.map(AnnualImage_Temp)
);
//print('Annual Image Collection of Temperature:', AnnualCollection_Temp);

