//************************************* Copy 'system' data from empty ImageCollection *******************************************

var sourceCollection_ETRef = emptyMonthlyCollection
var targetCollection_ETRef = imageCollection_ETRef
var sourceList_ETRef = sourceCollection_ETRef.toList(sourceCollection_ETRef.size());
var targetList_ETRef = targetCollection_ETRef.toList(targetCollection_ETRef.size());

var updatedImages_ETRef = ee.List.sequence(0, sourceList_ETRef.size().subtract(1)).map(function(i) 
{
  var sourceImage_ETRef = ee.Image(sourceList_ETRef.get(i));
  var targetImage_ETRef = ee.Image(targetList_ETRef.get(i));
  var timeStart_ETRef = sourceImage_ETRef.get('system:time_start');
  var timeEnd_ETRef = sourceImage_ETRef.get('system:time_end');

  return targetImage_ETRef
    .set('system:time_start', timeStart_ETRef)
    .set('system:time_end', timeEnd_ETRef)
});

var updatedCollection_ETRef = ee.ImageCollection.fromImages(updatedImages_ETRef);

//************************************* Rename all bands to 'etref' *******************************************

var renameBands = function(image) {
  var originalBandNames = image.bandNames();
  var newBandNames = ee.List.sequence(0, originalBandNames.length().subtract(1))
      .map(function(index) {
        return 'etref';
      });
  return image.rename(newBandNames);
};

var ETRef_Collection_month = updatedCollection_ETRef.map(renameBands);
//print('Monthly ImageCollection of ETRef', ETRef_Collection_month)

//************************************* Create Annual ImageCollection with 'etreal' as a band *******************************************

var AnnualImage_ETRef = function(year) {
  year = ee.Number(year);
  var annualCollection = ETRef_Collection_month
      .filter(ee.Filter.calendarRange(year, year, 'year'));
  var annualImage = annualCollection.sum();
  return annualImage
      .set('year', year)
      .set('system:time_start', ee.Date.fromYMD(year, 1, 1).millis());
};

var AnnualCollection_ETRef = ee.ImageCollection.fromImages(
    years.map(AnnualImage_ETRef)
);
